import React from 'react';
import logo from '../img/logo.png';

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="container">
                <div className="logo">
                    <img src={logo} alt="" />
                </div>
                <div className="links">Links</div>
            </div>
        </div>
    );
}

export default Navbar;
